import React from 'react';
import HeaderContact from './header_contactus/header_contactus';
import Footer from '../../parts/footer/footer';
import Persondetails from './contact_content/person_details';
import CheckSubjects from './contact_content/check_subjects/check_subjects';



class Contact extends React.Component{
  render(){
    return(
      <div>
        <HeaderContact/>
        <Persondetails/>
        <CheckSubjects/>
        <Footer/>
      </div>
    )
  }
}
export default Contact
